_forward-lan-start() {
	#_start

	_messageNormal '_forward-lan-start'

	local -a currentPORTlist=(8080 3100 3000)

	local currentSocatArgs=""
	#currentSocatArgs=",range=xxx.xxx.xxx.0/24,bind=<addr>"


	local currentPID
	local -a currentPIDlist=()

	local currentPort
	for currentPort in "${currentPORTlist[@]}"; do
		_messagePlain_probe socat -d -d TCP4-LISTEN:"$currentPort",reuseaddr,fork"$currentSocatArgs" TCP4:127.0.0.1:"$currentPort"
		nohup setsid "$scriptAbsoluteLocation" _prog_wrapper_bin_sequence socat -d -d TCP4-LISTEN:"$currentPort",reuseaddr,fork"$currentSocatArgs" TCP4:127.0.0.1:"$currentPort" > /dev/null 2>&1 &
		currentPID="$!"
		currentPIDlist+=("$currentPID")
		echo "$currentPID"
		sleep 0.1
	done

	
	disown -a -h -r
	disown -a -r


	_messageNormal 'DONE'
	sleep 5

	
	#for currentPID in "${currentPIDlist[@]}"; do
		#_pauseForProcess "$currentPID"
	#done

	#_pauseForProcess "$currentPID"
	#wait >&2

	#_stop
}


_forward-lan-stop() {
	_messageNormal '_forward-lan-start'

	( cd "$scriptAbsoluteFolder" && _terminateAll )
	#( cd "$scriptAbsoluteFolder" && _killAll )

	_messageNormal 'DONE'
	sleep 5
}






_forward-tailscale-disable() {
	_messageNormal '_forward-tailscale-disable'

	tailscale serve --https=8080 off
	tailscale serve --https=3100 off
	tailscale serve --https=3000 off

	tailscale serve status

	_messageNormal 'DONE'
	sleep 5
}



_forward-tailscale-enable() {
	_messageNormal '_forward-tailscale-enable'

	tailscale serve --bg --https=8080 localhost:8080
	tailscale serve --bg --https=3100 localhost:3100
	tailscale serve --bg --https=3000 localhost:3000

	tailscale serve status

	_messageNormal 'DONE'
	sleep 5
}











